item.value:
Sets a custom JWT Claims parameter value. A null value will remove the property from the Claims. This is a convenience method. It will first ensure a Claims instance exists as the JWT body and then set the named property on the Claims instance using the Claims put method. This allows you to write code like this: String jwt = Jwts.builder().claim("aName", "aValue").compact();
instead of this: Claims claims = Jwts.claims().put("aName", "aValue"); String jwt = Jwts.builder().setClaims(claims).compact();
if desired. Params: name – the JWT Claims property name value – the value to set for the specified Claims property name Returns: the builder instance for method chaining.

Sets the JWT Claims exp (expiration) value. A null value will remove the property from the Claims. A JWT obtained after this timestamp should not be used. This is a convenience method. It will first ensure a Claims instance exists as the JWT body and then set the Claims expiration field with the specified value. This allows you to write code like this: String jwt = Jwts.builder().setExpiration(new Date(System.currentTimeMillis() + 3600000)).compact();
instead of this: Claims claims = Jwts.claims().setExpiration(new Date(System.currentTimeMillis() + 3600000)); String jwt = Jwts.builder().setClaims(claims).compact();
if desired. Params: exp – the JWT exp value or null to remove the property from the Claims map. Returns: the builder instance for method chaining.

